import React from 'react'
import { Container,Button,Col, Row } from 'react-bootstrap';
const FormContainer = ({children}) => {
    return (
        <Container>
            <Row className='justify-content-md-center py-2'>
                <Col xs={12} md={6}>
                    {children}
                </Col>
            </Row>
        </Container>
    )
}

export default FormContainer
